import './HomePageBody.css';
import React, { useState, useEffect } from 'react';
import CircleCard from './Card/CircleCard';
import community from './image/community.svg';
import Carousel from './Carousel';

export default function HomePageBody() {
    const [carouselData,setCarouseData]=useState([]);

    useEffect(()=>{
        fetch('')
        .then((response) => response.json())
        .then((data) => setCarouselData(data))
        .catch((error) => console.error('Error fetching carousel data:', error));
    },[]);


    return(
    <div className="body"> 
        <div className="carouselImage">
        {carouselData.length > 0 ? (
        <Carousel images={carouselData} />
      ) : (
        <p>Loading...</p>
      )}
        </div>
        <div className="communityRec">
            <CircleCard>
            <img width="25px" src={community} className="communityIcon" alt="community" />
            <a className="communityText"  href="https://www.baidu.com">社区讨论</a>
            </CircleCard>
        </div>
    </div>
           
    );
}
